function lastId() {
    var aL = oldQ.length - 1;
	if (oldQ[aL].id == null || oldQ[aL].id == undefined || oldQ.length < 1) {
		uniqueID = d.getYear() + "" + d.getHours() + "" + d.getMinutes();
		document.getElementById("quoteID").innerHTML = uniqueID;
	}
	else {
 	var lastId = oldQ[aL].id;
	var newId = lastId + 1;
	document.getElementById("quoteID").innerHTML = newId;
	uniqueID = newId;
	}
}

function searchQuotes() {
	var searchTerms = document.getElementById("searchMe").value;
	var out = "";
	var limit = oldQ.length - 50;
	for(var i = oldQ.length - 1; i > -1  && i > limit; i--) {
	  if (oldQ[i].id.toString().includes(searchTerms) || oldQ[i].name.includes(searchTerms) || searchTerms.length == 0) {
		var objectsPlease = JSON.stringify(oldQ[i]);
		var objectWidth = objectWidthtalk();
		function objectWidthtalk (){
			if (oldQ[i].width === 0) {
				return 12;
			}
			else {
				return (oldQ[i].width * 2) + 16;
			}
		};
		out += "<tr><td><a href='#' onClick='beamMeUp2(" + objectsPlease + ")' >" + oldQ[i].id + "</a></td><td>" + oldQ[i].name + "</td><td>" + oldQ[i].gauge + "</td><td>" + objectWidth  + "'</td><td>" + ((oldQ[i].length * 5) + 21) + "'</td><td>" + (oldQ[i].legHeight + 6) + "'</td><td>" + oldQ[i].date.slice(0, 11).replace('T', ' ') + "</td></tr>";
		}
	  }
	if (out.length == 0) {
	  out = "<tr><td>No search results were returned. Sorry!</td></tr>"
	}
	document.getElementById("searchResults").innerHTML = "<table class='oldQuoteList' ><tr><th>Quote #</th><th>Name:</th><th>Guage:</th><th>Width:</th><th>Length:</th><th>Height:</th><th>Date:</th></th>" + out + "</table>";
	document.getElementById("hideButton").innerHTML = "<input type='button' id='hideshow' value='Hide Results' onclick='hideResults()'/>";
 }

