function anchorQtyCalc() {
	var lengthPlease = parseInt(document.getElementById("length").value) || 0;
	var endsyes = parseInt(document.getElementById("endsenclosed").value) || 0;
	var bothendsyes = parseInt(document.getElementById("bothends").value) || 0;
	var doorsyes = parseInt(document.getElementById("6x6").value + document.getElementById("8x7").value + document.getElementById("9x7").value + document.getElementById("10x8").value + document.getElementById("10x10").value) || 0;
	var anchorAddUp = anchorWeightAdd() || 0;
	function anchorWeightAdd() {
		if (endsyes == 0) {
		return 0;
	} else if (endsyes == 1 && bothendsyes == 0) {
		return 1;
	} else if (bothendsyes == 1 && doorsyes < 2 ) {
		return 2;
	} else if (bothendsyes == 1 && doorsyes >= 2) {
		return 3;
	}
	}
	var doublemeup = doublemeupcalc();
	function doublemeupcalc() {
		if (document.getElementById("double").value == "yes") {
			return 2;
		}
		else {
			return 1;
		}
	}
	var mobileQty = anchorsQtyArray1[lengthPlease][anchorAddUp] * doublemeup;
	var concreteQty = anchorsQtyArray2[lengthPlease][anchorAddUp] * doublemeup;
	var supportQty = anchorsQtyArray3[lengthPlease] * doublemeup;

	document.getElementById("mobilehomeanchors").innerHTML = " - Mobile Home Anchors (" + mobileQty + " recommended) AND Supports if over 9'";
	document.getElementById("asphaltanchors").innerHTML = " - Asphalt Anchors (" + mobileQty + " recommended)";
	document.getElementById("concreteanchors").innerHTML = " - Concrete Anchors (" + concreteQty + " recommended)";
	document.getElementById("supportanchors").innerHTML = " - Supports  (" + supportQty + " recommended)";
	
}


